[stepper_x]
step_pin: x_step_pin
dir_pin: x_dir_pin
enable_pin: !x_enable_pin
rotation_distance: 40
microsteps: 64
endstop_pin: toolboard:PB9
homing_speed: 400
homing_retract_dist: 5.0
